class Posts extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      words: [],
      isLoaded: false,
    };
  }
  componentDidMount() {
    fetch(`https://jsonplaceholder.typicode.com/posts`, {
    	"method": "GET"
    })
    .then(res => res.json())
    .then(json => {
      this.setState({
        isLoaded: true,
        words: json,
      })
    });
  }
  render() {
    var { isLoaded, Posts } = this.state;

    if (!isLoaded) {
      return <div>Loading...</div>
    } else {
      return (
        <div className="container">
          text
          {console.log(Posts)}
        </div>
      )
    }
  }
}

export default Posts;
